import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return (
        <div className="sidebar">
            <div className="id">
                <div className="idContent">
                    <img src="./media/billGates.jpeg" alt="profil-pic"/>
                    <h3>Bret Marian</h3>
                </div>
            </div>
        </div>
    );
};

export default Navigation;
